import * as React from 'react';
import PropTypes from 'prop-types';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`vertical-tabpanel-${index}`}
      aria-labelledby={`vertical-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box sx={{ p: 3 }}>
          <Typography>{children}</Typography>
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.number.isRequired,
  value: PropTypes.number.isRequired,
};

function a11yProps(index) {
  return {
    id: `vertical-tab-${index}`,
    'aria-controls': `vertical-tabpanel-${index}`,
  };
}

export default function VerticalTabs({ groups }) {
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const [name, setName] = useState('');
  const [items, setItems] = useState([]);
  const [selectedGroupId, setSelectedGroupId] = useState(null);

  const [newItemName, setNewItemName] = useState('');
  const [newItemPrice, setNewItemPrice] = useState('');
  const [addItemError, setAddItemError] = useState(null);
  const [removeItemError, setRemoveItemError] = useState(null);

  return (


    <Box sx={{ flexGrow: 1, bgcolor: 'background.paper', display: 'flex', height: "auto" }}>
      <Tabs
        orientation="vertical"
        variant="scrollable"
        value={value}
        onChange={handleChange}
        aria-label="Vertical tabs example"
        sx={{ borderRight: 1, borderColor: 'divider' }}
      >
        {groups.map((group, index) => (
          <Tab label={group.name} {...a11yProps(index)} key={index} />
        ))}
      </Tabs>
      {groups.map((group, index) => (
        <TabPanel value={value} index={index} key={index}>
          <li key={group._id}>
              <div>
                <span>{group.name}</span>
                <button onClick={() => deleteGroup(group._id)}>Delete</button>
                <button onClick={() => setSelectedGroupId(group._id)}>Show Items</button>
              </div>
              {selectedGroupId === group._id && (
                <>
                  <ul>
                    {groupItems && groupItems.length > 0 &&
                      groupItems.map((item) => (
                        <li key={item._id}>
                          {item.name} - ${item.price}
                          <button onClick={() => handleRemoveItem(group._id, item._id)}>Remove</button>
                        </li>
                      ))}
                  </ul>
                  <ul>
                    <h3>Members</h3>
                    {groupMembers && groupMembers.length > 0 &&
                      groupMembers.map((member) => (
                        <li key={member._id}>{member.name}</li>
                      ))}
                  </ul>
                </>
              )}
              <form onSubmit={(e) => {
                e.preventDefault();
                handleAddItem(group._id);
              }}>
                <input
                  type="text"
                  placeholder="Item name"
                  value={newItemName}
                  onChange={(e) => setNewItemName(e.target.value)}
                />
                <input
                  type="number"
                  placeholder="Item price"
                  value={newItemPrice}
                  onChange={(e) => setNewItemPrice(e.target.value)}
                />
                <button type="submit">Add Item</button>
              </form>
              {addItemError && <div className="error">{addItemError}</div>}
              {removeItemError && <div className="error">{removeItemError}</div>}
              {fetchGroupItemsError && <div className="error">{fetchGroupItemsError}</div>}
            </li>
        </TabPanel>
      ))}
    </Box>
  );
}
